[{"location":"","page":"Home","title":"Home","text":"CurrentModule = LyapunovExponents","category":"page"},{"location":"#LyapunovExponents","page":"Home","title":"LyapunovExponents","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Documentation for LyapunovExponents.","category":"page"},{"location":"","page":"Home","title":"Home","text":"","category":"page"},{"location":"","page":"Home","title":"Home","text":"Modules = [LyapunovExponents]","category":"page"},{"location":"#LyapunovExponents.LyapunovExponents","page":"Home","title":"LyapunovExponents.LyapunovExponents","text":"A module to calculate lyapunov exponents.\n\n\n\n\n\n","category":"module"},{"location":"#LyapunovExponents.Network","page":"Home","title":"LyapunovExponents.Network","text":"struct Network{T1<:LyapunovExponents.Dynamics, T2<:(AbstractMatrix{T} where T), T3<:(AbstractMatrix{T} where T)}\n\nNetwork of dynamical system nodes. \n\nFields\n\nnodes::Vector{T1} where T1<:LyapunovExponents.Dynamics\nDynamical system nodes\nE::AbstractMatrix{T} where T\nOuter coupling matrix\nP::AbstractMatrix{T} where T\nInner coupling matrix\n\n\n\n\n\n","category":"type"},{"location":"#LyapunovExponents.addlink!","page":"Home","title":"LyapunovExponents.addlink!","text":"addlink!(net, i, j)\naddlink!(net, i, j, w)\n\n\nAdds a link between the nodes i and j with weight w. \n\n\n\n\n\n","category":"function"},{"location":"#LyapunovExponents.deletelink!-Tuple{Network, Int64, Int64}","page":"Home","title":"LyapunovExponents.deletelink!","text":"deletelink!(net, i, j)\n\n\nDeletes the links between the nodes i and j \n\n\n\n\n\n","category":"method"},{"location":"#LyapunovExponents.dimension-Tuple{LyapunovExponents.Dynamics}","page":"Home","title":"LyapunovExponents.dimension","text":"dimension(ds)\n\n\nReturns the dimension of ds \n\n\n\n\n\n","category":"method"},{"location":"#LyapunovExponents.eigenmodes-Tuple{Network}","page":"Home","title":"LyapunovExponents.eigenmodes","text":"eigenmodes(net)\n\n\nReturns eigenmodes, i.e. a vector of pairs of eigenvalues of the outer coupling matrix of net and corresponding maximum Lyapunov exponent. \n\n\n\n\n\n","category":"method"},{"location":"#LyapunovExponents.haslink-Tuple{Network, Int64, Int64}","page":"Home","title":"LyapunovExponents.haslink","text":"haslink(net, i, j)\n\n\nReturns true if there exists a link between the nodes i and j.\n\n\n\n\n\n","category":"method"},{"location":"#LyapunovExponents.isadjacency-Tuple{Network}","page":"Home","title":"LyapunovExponents.isadjacency","text":"isadjacency(net)\n\n\nReturns true if net is constructed using adjacency matrix \n\n\n\n\n\n","category":"method"},{"location":"#LyapunovExponents.islaplacian-Tuple{Network}","page":"Home","title":"LyapunovExponents.islaplacian","text":"islaplacian(net)\n\n\nReturns true if net is constructed using laplacian matrix \n\n\n\n\n\n","category":"method"},{"location":"#LyapunovExponents.isstable-Tuple{Network}","page":"Home","title":"LyapunovExponents.isstable","text":"isstable(net)\n\n\nReturns true if net is stable. Stability analyis is performed via master stability function.\n\n\n\n\n\n","category":"method"},{"location":"#LyapunovExponents.lyapunovs-Tuple{LyapunovExponents.Dynamics}","page":"Home","title":"LyapunovExponents.lyapunovs","text":"lyapunovs(ds; kwargs...)\n\n\nComputes lyapunov exponents of ds.kwargs may include \n\nnsteps::Int = 3e4    Number of steps to calculate lypaunov exponents \nntrsteps::Int = 0   Number of transient steps for transient steps. Transient steps are taken before calculation of lypaunov exponents \ndt::Real = 0.01   Step size of integrator. \n\n\n\n\n\n","category":"method"},{"location":"#LyapunovExponents.msf-Tuple{LyapunovExponents.Dynamics, Real, AbstractMatrix{T} where T}","page":"Home","title":"LyapunovExponents.msf","text":"msf(ds, Î», P; kwargs...)\n\n\nMaster stability function (msf). Returns maximum lyapunov exponent. kwargs may include \n\nnsteps::Int = 3e4    Number of steps to calculate lypaunov exponents \nntrsteps::Int = 0   Number of transient steps for transient steps. Transient steps are taken before calculation of lypaunov exponents \ndt::Real = 0.01   Step size of integrator. \n\n\n\n\n\n","category":"method"},{"location":"#LyapunovExponents.rewirelink!-Tuple{Network, Int64, Int64, Int64, Int64}","page":"Home","title":"LyapunovExponents.rewirelink!","text":"rewirelink!(net, i, j, k, l)\n\n\nRemoves the link from between the nodes i and j and wires the link between the nodes k and l. \n\n\n\n\n\n","category":"method"},{"location":"#LyapunovExponents.scale_connection_matrix!-Tuple{AbstractMatrix{T} where T}","page":"Home","title":"LyapunovExponents.scale_connection_matrix!","text":"scale_connection_matrix!(W0)\n\n\nNormalize the connection matrix of net. The connectin matrix is rescaled such that on-diagonal elements becones 1. \n\n\n\n\n\n","category":"method"},{"location":"#LyapunovExponents.solvenet","page":"Home","title":"LyapunovExponents.solvenet","text":"solvenet(net, tspan)\nsolvenet(net, tspan, alg; solkwargs...)\n\n\nSolves the network differential equation \n\n\n\n\n\n","category":"function"},{"location":"#LyapunovExponents.stablemodes-Tuple{Network}","page":"Home","title":"LyapunovExponents.stablemodes","text":"stablemodes(net)\n\n\nReturns stable eigen modes of net. \n\n\n\n\n\n","category":"method"},{"location":"#LyapunovExponents.unstablemodes-Tuple{Network}","page":"Home","title":"LyapunovExponents.unstablemodes","text":"unstablemodes(net)\n\n\nReturns unstable eigen modes of net. \n\n\n\n\n\n","category":"method"},{"location":"#LyapunovExponents.updatelink!","page":"Home","title":"LyapunovExponents.updatelink!","text":"updatelink!(net, i, j)\nupdatelink!(net, i, j, w)\n\n\nAddes a link between the nodes i and j of the network net. w is the weight of the link to be updated.\n\n\n\n\n\n","category":"function"}]
